import React from "react";
import Header from './Header'
import Hero from './Hero'
import Main from './Main'
import Footer from "./Footer";

const router = createBrowserRouter([
    {
      path: "/",
      element: <Header />,
    },
  ]);

function App(){
    return(
        <React.StrictMode>
        <RouterProvider router={router} />
      </React.StrictMode>
    )
}

export default App
